import React from "react";
import "./Header.css";
const Header = () => {
  return (
    <div class="row navbar_upper">
      <div class="col-xl-2 col-lg-2  col-md-2 col-sm-2 socials">FACEBOOK</div>
      <div class="col-xl-2 col-lg-2  col-md-2 col-sm-2 socials">INSTAGRAM</div>
      <div class="col-xl-2 col-lg-2  col-md-2 col-sm-2 socials">TELEGRAM</div>
      <div class="col-xl-2 col-lg-2  col-md-2 col-sm-2 socials">TWITTER</div>
      <div class="col-xl-2 col-lg-2  col-md-2 col-sm-2 socials">GMAIL</div>
      {/* <div class="col-xl-2 col-lg-2  col-md-2 col-sm-2 socials">Google</div> */}
    </div>
  );
};

export default Header;
